我一直很想聊聊女性主义，但一直不知道从何开始。《瞬变》那一期里讲，太多选择等于没有选择，在女性主义这个议题上，的的确确就是这样。是从对女性的各种刻板印象讲起呢，还是从职场歧视讲起？那家庭分工困境、育儿的代价、被重男轻女的父母吸血呢？亲密关系中的各种底层矛盾呢？各种场合的骚扰呢？造黄谣和荡妇羞辱呢？还有物化女性所导致的颜值焦虑、身材焦虑；夺取女性的名字，代之以母亲、主妇、妻子、处女……太多选择了，骑象人完全陷入决策瘫痪�‍️。
直到读到《从零开始的女性主义》，我突然明白了，应该从哪里讲起。
这一期跟以前的节目相比，多了很多我的个人反思、战斗经验。因为我觉得除了从理论上理解这些深刻的问题，在实践上看到别人是怎么想的，怎么做的，不管对不对，都很重要；因为在这场必将旷日持久的斗争中，我们每个人的光现在还是太微弱了，更需要让点点星火亮起来，最终彼此照亮。
正好最近《再见爱人4》开播了，其中三对嘉宾，完全对应着今天讲的女性主义的内容，我也在这期节目中，点评了这三对夫妻。
希望大家能喜欢这期节目，也希望它能抛砖引玉，触发长久的讨论。我们评论区见～
